package cn.com.phinfo.protocol;import java.util.List;import java.util.Stack;import com.heqifuhou.protocolbase.HttpResultBeanBase;import com.heqifuhou.protocolbase.QuickRunObjectBase;public class AttendsettingsWifiListRun extends QuickRunObjectBase {	public AttendsettingsWifiListRun() {		super(LURLInterface.GET_HR_ATTENDSETTINGS_WIFI_GETLIST(), null,				AttendWifiSettingsResultBean.class);	}	public static class AttendWifiSettingsResultBean extends HttpResultBeanBase {		private List<AttendWifiSettingsItem> data = new Stack<AttendWifiSettingsItem>();		public List<AttendWifiSettingsItem> getData() {			return data;		}		public void setData(List<AttendWifiSettingsItem> data) {			this.data = data;		}		public boolean isCon(AttendWifiSettingsItem it) {			for (AttendWifiSettingsItem old : getData()) {				if (old.getAddress().toLowerCase()						.equals(it.getAddress().toLowerCase())) {					if (old.getName().toLowerCase()							.equals(it.getName().toLowerCase())) {						return true;					}				}			}			return false;		}	}	public static class AttendWifiSettingsItem {		private String name;		private String address;		private String connectedQty;		private String attendwifiid;		private boolean Checked = false;		public boolean getChecked() {			return Checked;		}		public void setChecked(boolean checked) {			Checked = checked;		}		public String getName() {			return name;		}		public void setName(String name) {			this.name = name;		}		public String getAddress() {			return address;		}		public void setAddress(String address) {			this.address = address;		}		public String getConnectedQty() {			return connectedQty;		}		public void setConnectedQty(String connectedQty) {			this.connectedQty = connectedQty;		}		public String getAttendwifiid() {			return attendwifiid;		}		public void setAttendwifiid(String attendwifiid) {			this.attendwifiid = attendwifiid;		}	}}